import logo from './logo.svg';
import './App.css';
import Sticky from './components/header/banner';
import First from './components/sections/first';
import Playlists from './components/sections/playlist';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
import Hope from './components/sections/hope';

function App() {
  return (
    <>
   <Router>
      <div>
        <Routes exact path="/" component={Playlists} />
        <Routes path="/item/:id" component={Hope} />
      </div>
    </Router>
    </>
  );
}

export default App;
